import React from 'react';
import './Toolbar.css';

const toolbar = props => {
    <header className="toolbar">
        <nav className="toolbar__nabigation">
            <div></div>
            <div className="toolbar__logo"><a href='/'>THE LOGO</a></div>
            <div className="toolbar__navigatoin-items">
                <ul>
                    <li><a href="/">Products</a></li>
                    <li><a href="/">User</a></li>

                </ul>
            </div>
        </nav>
    </header>
};

export default Toolbar;
